Sinderella &amp; Me (NEW 2014 Sweet Sinner) (Split Scenes)

Allie Haze, Darla Crane, Dylan Ryan, Jiz Lee, Manuel Ferrara, Wolf Hudson

Sweet Sinner revisits one of the most romantic fables of all time, adding raw sex, passion and explosive orgasms to the classic fairy tale. Allie Haze plays the gorgeous servant daughter whose evil step-mother (Darla Crane) and ugly stepsisters (Dylan Ryan and Jiz Lee) are determined to keep her away from rich bachelor Manuel's 30th birthday bash. When servant boy Wolf Hudson steps in to help the lovely Sinderella, the stepsisters decide to punish him by forcing the hot young stud into a scorching three-way. Fairy godmother DeLUXE comes to the rescue, and Sinderella heads to the ball where she and Manuel fall in love at first sight. But what dirty little secrets do Manuel and Darla share, and how will the evil MILF use them to get her way with the &quot;charming&quot; Manuel? A surprising plot twist carries you along to a happy ending even better than an orgasm - but you'll have plenty of those, too. Starring Allie Haze, Manuel Ferrara, Jiz Lee, Dylan Ryan, Darla Crane, and Wolf Hudson. Screenplay and directed by Nica Noelle.

